Notes: 
This show is being webcast via LivePhish. This was the first show of the Magnaball festival. TMWSIY and Avenu Malkenu were played for the first time since July 4, 2012 (124 shows). After Free, Trey asked the crowd to sing Happy Birthday to his daughter, Eliza, who briefly joined him onstage. Mock Song was played for the first time since July 12, 2003 (320 shows), and featured a lyric change to &quot;Clifford, Super, Magnaball.&quot; CDT and Ghost both contained What's the Use? teases. Hood contained a CTB tease from Mike
